import React, { Component, State } from 'react';
import { Document, Page } from 'react-pdf';

import resumePdf from "./../img/resume.pdf";


class Resume extends Component {

    render() {
        return(
            <div>
                <Document file={resumePdf}>
                    <Page pageNumber={1} />
                </Document>
            </div>
        )
    }
}

export default Resume;
